import React from "react";
import data from "../data";

function ArrayMainScreen(props) {

    return (
        <div className="algorithms">
            <p>Select an algorithm you want to see!</p>
            <ul>
            {
                data.algorithms.map(algorithm =>
                        <li key={algorithm._id}>
                            <button className="btn" data-toggle="collapse" data-target="#collapseTest">
                                {algorithm.name}
                            </button>
                            <div className="collapse" id="collapse" id="collapseTest">
                                <div className="card card-body">
                                    It works!
                                </div>
                            </div>
                        </li>)

            }
            </ul>
        </div>

    )
}

export default ArrayMainScreen;
